ult `x` is a reference. If `x` is already realized, then Notespace renders `@x` (dereferenced `x`) instead of `x`. Otherwise, you should see a mark that says it is still pending.\\n\\nFor example:\"]]], \"186\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"3\\n\"}]]], \"66\" [:div [:p/code {:code \"p2\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"152\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 3}\\n\"}]]], \"181\" [:div [:p/code {:code \"^k/dataset\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (cycle \\\"abc\\\")}\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p/aggrid {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData [{\"x\" 0, \"y\" 0.07257247551058521, \"z\" \\a} {\"x\" 1, \"y\" 0.7861351225738351, \"z\" \\b} {\"x\" 2, \"y\" 0.021923950671236536, \"z\" \\c} {\"x\" 3, \"y\" 0.9918443589266196, \"z\" \\a} {\"x\" 4, \"y\" 0.46158601159474844, \"z\" \\b} {\"x\" 5, \"y\" 0.463735719969639, \"z\" \\c} {\"x\" 6, \"y\" 0.5897856633952617, \"z\" \\a} {\"x\" 7, \"y\" 0.47860679688689456, \"z\" \\b} {\"x\" 8, \"y\" 0.9315413959952387, \"z\" \\c}]}]]]], \"184\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"100\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"106\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"173\" [:div nil [:div [:big [:big 3]]]], \"90\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"190\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"112\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"148\" [:div [:p/code {:code \"(require '[notespace.api :refer [A]])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"137\" [:div [:p/code {:code \"(require '[notespace.api :refer [F]])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"140\" [:div nil [:div [:p/markdown \"The following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"136\" [:div nil [:div [:p/markdown \"### Futures\"]]], \"166\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]]], \"121\" [:div nil [:div nil]], \"62\" [:div [:p/code {:code \"(def p1 (promise))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"75\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"194\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"168\" [:div nil [:div [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]]], \"76\" [:div [:p/code {:code \"(require '[notespace.api :refer [D]])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"154\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div nil]], \"110\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"97\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"94\" [:div [:p/code {:code \"^k/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"174\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"171\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"99\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"130\" [:div [:p/code {:code \"(def p2 (promise))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#'notespace.v3-experiment1-test/p2\\n\"}]]], \"183\" [:div [:p/code {:code \"[:hiccup [:big [:big 3]]]\", :bg-class \"bg-light\"}] [:div [:hiccup [:big [:big 3]]]]], \"122\" [:div nil [:div [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"149\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"(0.2310976640728717\\n 0.28215287552205803\\n 8.186037043865779E-4\\n 0.13087839929145106\\n 0.23099163560482827\\n -0.06517361129754573\\n -0.4613382053060566\\n -0.9424144293542316\\n -0.8408608069214212)\\n\"}]]], \"120\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"70\" [:div [:p/code {:code \"(require '[notespace.api :refer [F]])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"144\" [:div nil [:div [:p/markdown \"The `D` macro allows to define a Clojure delay that informs Notespace when it is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"134\" [:div nil [:div [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]]], \"77\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"146\" [:div nil [:div [:p/markdown \"If you called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]]], \"63\" [:div [:p/code {:code \"(def p2 (promise))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"84\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"177\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]]], \"125\" [:div nil [:div [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"104\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"95\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"102\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"165\" [:div nil [:div [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]]], \"153\" [:div nil [:div [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]]], \"74\" [:div [:p/code {:code \"(F (take 9 @x))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"142\" [:div nil [:div [:p/markdown \"### Delays\"]]], \"127\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"109\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"124\" [:div [:p/code {:code \"(+ 1 2\\n   3 4\\n   5 6)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"21\\n\"}]]], \"138\" [:div nil [:div [:p/markdown \"The `F` macro allows to define a Clojure future that informs Notespace when it is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"114\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"56\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"133\" [:div [:p/code {:code \"p2\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"147\" [:div nil [:div [:p/markdown \"### Atoms\"]]], \"151\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#'notespace.v3-experiment1-test/a\\n\"}]]], \"55\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"182\" [:div nil [:div [:p/markdown \"## Other ways to specify note kinds\\n\\nA note's kinds can also be specified by including it in a vector beginning with a keyword. This is inspired by the approach of [Oz](https://github.com/metasoarous/oz), and should allow some partial compatibility with Oz notebooks.\"]]], \"85\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"189\" [:div [:p/code {:code \"(A a)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"{:x 4}\\n\"}]]], \"126\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"143\" [:div [:p/code {:code \"(require '[notespace.api :refer [D]])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"178\" [:div nil [:div [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]]], \"72\" [:div [:p/code {:code \"(def x\\n  (future\\n   (Thread/sleep 2000)\\n   (->> #(- (rand) 0.5)\\n        (repeatedly 999)\\n        (reductions +))))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"170\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"54\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"131\" [:div [:p/code {:code \"(deliver p2 14)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"103\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"91\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"65\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"161\" [:div nil [:div [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]]], \"129\" [:div [:p/code {:code \"(def p1 (promise))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"#'notespace.v3-experiment1-test/p1\\n\"}]]], \"187\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"71\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"164\" [:div nil [:div nil]], \"163\" [:div nil [:div [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]]], \"86\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"64\" [:div [:p/code {:code \"(deliver p2 14)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"92\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"79\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"160\" [:div nil [:div [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]]], \"150\" [:div nil [:div [:p/markdown \"The `A` function allows to define a Clojure atom that informs Notespace when it changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"117\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"132\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]]}}");
